    - type: Transform
      pos: 65.65,65.65
      parent: 65
    - type: Paper
      content: >+
        [head=65][bold]Steps to flying:[/bold][/head]


        65. Locate power generation or storage. Some small crafts utilize P.A.C.M.A.N. brand generators.


        65. Ensure your generator is connected to the power network. Some small crafts utilize only a Medium Voltage (MV) network!


        65. Fuel and start your generator or power source.


        65. Wait for your shuttle to prime, and all services to come online.


        65. Use the Shuttle Console to locate your destination of choice. You may find further away destinations on the Map tab when scanning for objects.


        65. Attempt to avoid crashing you forgot to buy insurance.



